const ImageGridListStyle = {
	root: {
	    display: 'flex',
	    flexWrap: 'wrap',
	    justifyContent: 'space-around',
	    overflow: 'hidden',
	},
	gridList: {
		width: "100%",
		height: "auto"
	},
	gridImg: {
		width: "66.6667% !important",
	    height: "164px !important",
	    padding: "2px !important"
	},
	image: {
	    position: 'relative',
	},
	imageButton: {
		position: 'absolute',
		left: 0,
		right: 0,
		top: 0,
		bottom: 0,
		display: 'flex',
		alignItems: 'center',
		justifyContent: 'center',
		color: "white"
	},
	imageSrc: {
		position: 'absolute',
		left: 0,
		right: 0,
		top: 0,
		bottom: 0,
		backgroundSize: 'cover',
		backgroundPosition: 'center 40%',
	},
};

export default ImageGridListStyle;
